// Libs
import React from "react";
import PropTypes from "prop-types";
import classnames from "classnames";

// Components
import { Chip } from "./Chip";
import { ChipAction } from "./ChipAction";

export function ChipContainer({ children, className, ...otherProps }) {
    const containerClassName = classnames("brain-c-chip-container", className);

    return (
        <div className={containerClassName} {...otherProps}>
            {children}
        </div>
    );
}

ChipContainer.propTypes = {
    /**
     * Children chips
     */
    children: PropTypes.arrayOf(PropTypes.oneOfType([PropTypes.instanceOf(Chip), PropTypes.instanceOf(ChipAction)])),
    /**
     * Additional className for container
     */
    className: PropTypes.string,
};
